import React, { useState, useCallback } from 'react';
import AddAsset from './addasset';
import AddCategory from './addcategory';
import AssetLocation from './assetlocation';

const AssetTable = () => {
  const [assets, setAssets] = useState([]);
  const [categories, setCategories] = useState([]);
  const [locations, setLocations] = useState([]);

  // Handler for adding an asset
  const handleAddAsset = useCallback((newAsset) => {
    console.log('Asset received in AssetTable:', newAsset); // Debugging line
    setAssets((prevAssets) => [...prevAssets, newAsset]);
  }, []);

  // Handler for adding a category
  const handleAddCategory = useCallback((newCategoryData) => {
    setCategories((prevCategories) => [...prevCategories, newCategoryData]);
    console.log('Category saved:', newCategoryData); // Debugging line
  }, []);

  // Handler for adding a location
  const handleAddLocation = useCallback((newLocation) => {
    setLocations((prevLocations) => [...prevLocations, newLocation]);
    console.log('Location saved:', newLocation); // Debugging line
  }, []);

  return (
    <div className="relative p-4 w-[1477px] h-[1050px] border-radius-8">
      {/* Button Container */}
      <div className="flex gap-4 mb-4">
        <AddAsset
          onAddAsset={handleAddAsset}
          categories={categories}
          locations={locations}
        />
        <AddCategory onSaveCategory={handleAddCategory} />
        <AssetLocation onSaveLocation={handleAddLocation} />
      </div>

      {/* White Content Area */}
      <div className="flex flex-col items-start gap-1 p-4 bg-white border-radius-8 h-full">
        <h2 className="text-xl font-semibold mb-4">Asset Management</h2>
        <div className="w-full">
          {assets.length > 0 ? (
            <table className="w-full border-collapse">
              <thead>
                <tr className="border-b">
                  <th className="p-2">Asset ID</th>
                  <th className="p-2">Created Date</th>
                  <th className="p-2">Asset Name</th>
                  <th className="p-2">Asset Details</th>
                  <th className="p-2">Category</th>
                  <th className="p-2">Subcategory</th>
                  <th className="p-2">Location</th>
                  <th className="p-2">Quantity</th>
                  <th className="p-2">Cost</th>
                </tr>
              </thead>
              <tbody className="text-center">
                {assets.map((asset, index) => (
                  <tr key={index} className="border-b">
                    <td className="p-2">{asset.assetID}</td>
                    <td className="p-2">{asset.createdDate}</td>
                    <td className="p-2">{asset.assetName}</td>
                    <td className="p-2">{asset.assetDetails}</td>
                    <td className="p-2">{asset.selectedCategory}</td>
                    <td className="p-2">{asset.selectedSubCategory}</td>
                    <td className="p-2">{asset.selectedLocation}</td>
                    <td className="p-2">{asset.quantity}</td>
                    <td className="p-2">{asset.cost}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>No assets available.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default AssetTable;
